import Header from "./common/Header";
export default function Login() {
  return (
    <>
      <Header />
      <section>
        <div className="w-full h-auto">
          <div>
            <h2>Chào mừng bạn đến với chúng tôi</h2>
          </div>
          <div>
            <input />
            <label></label>
          </div>
        </div>
      </section>
    </>
  );
}
